import React from "react";
import {
  StyleSheet,
  Text,
  View,
  KeyboardAvoidingView,
  Image,
  TextInput,
} from 'react-native';

const Profile = () => {
  return(
    <KeyboardAvoidingView behavior='padding' style={style.wrapper}>
      <Image style={styles.container} source={require('./img/background.jpg')}>

      </Image>
    </KeyboardAvoidingView>
  )
}


const styles = StyleSheet.create({
  wrapper: {
    flex: 1,
  },
  container: {
    flex: 1,
    alignSelf: 'stretch',
    width: null,
    justifyContent: 'center',
    alignItems: 'center',
  }
})


export default Profile;
